import React, { Component } from 'react';
import Menu from './partials/Menu';

class MenuDashboard extends Component {

    filtrarNoticias = topico => {
        console.log("Poderíamos exibir notícias de outros lugares como: ", topico);
    }

    render(){
        return(
            <div>
                <nav>
                    <ul>
                        <li><span onClick={this.filtrarNoticias("escolha")}>Sua escolha</span></li>
                        <li><span onClick={this.filtrarNoticias("estado")}>No estado</span></li>
                        <li><span onClick={this.filtrarNoticias("regiao")}>Na região</span></li>
                        <li><span onClick={this.filtrarNoticias("pais")}>No país</span></li>
                    </ul>
                </nav>
            </div>
        )
    }
}

class Dashboard extends Component{
    render(){
        return(
            <div>
                <Menu ativo="dashboard" />
                <div className="dashboard">
                    <MenuDashboard />
                </div>
            </div>
        )
    }
}

export default Dashboard;
